import { Data } from "./Data"
import React from 'react';
import { Subgrid, SuperSubgrid } from "./Counteranimation.element";
function Component(props) {
    return (
        <Subgrid>
            <SuperSubgrid>
                <div>{props.state}</div>
                <div>{props.customer}</div>
                <div>{props.descrip}</div>

                </SuperSubgrid>
        </Subgrid>
       
    )
}

export default Component
